<script setup>
import { createUserWithEmailAndPassword } from 'firebase/auth';
import { auth } from '../auth/firebase';
import { reactive, ref } from 'vue'
import { ElMessage } from 'element-plus'
import { useRouter } from "vue-router"
import { send } from '@/api/send'
const sendTemplate = {
    personalizations: [
        {
            to: [{ email: "wmao0004@student.monash.edu", name: "wmao0004@student.monash.edu" }],
            subject: "Account Registration Notice!"
        }],
    content: [{ type: "text/plain", value: "Congratulations on the successful registration of your account!" }],
    from: { email: "wmao0004@student.monash.edu", name: "Senior Charity Foundation" },
    reply_to: { email: "wmao0004@student.monash.edu", name: "Senior Charity Foundation" },
    attachments: [
        {
            content: '',
            filename: 'image.jpg',
            type: 'image/jpeg',
            disposition: 'attachment'
        }
    ],
}
const router = useRouter()
// Reference to the form element for validation
const ruleFormRef = ref()
const ruleForm = reactive({
    email: '',
    pass: '',
    checkPass: '',
})
// Validate the password input
const validatePass = (rule, value, callback) => {
    if (value === '') {
        callback(new Error('Please input the password'));
    } else {
        if (ruleForm.checkPass !== '') {
            if (!ruleFormRef.value) return;
            ruleFormRef.value.validateField('checkPass');
        }
        callback();
    }
};
// Validate the confirmation password input
const validatePass2 = (rule, value, callback) => {
    if (value === '') {
        callback(new Error('Please input the password again'));
    } else if (value !== ruleForm.pass) {
        callback(new Error("Two inputs don't match!"));
    } else {
        callback();
    }
};
// Validation rules for the form fields
const rules = reactive({
    name: [
        { required: true, message: 'Please input Activity name', trigger: 'blur' },
        { min: 3, max: 5, message: 'Length should be 3 to 5', trigger: 'blur' },
    ],
    pass: [{ validator: validatePass, trigger: 'blur' }],
    checkPass: [{ validator: validatePass2, trigger: 'blur' }],
    type: [
        {
            required: true,
            message: 'Please select Activity count',
            trigger: 'change',
        },
    ],
    email: [
        { required: true, message: 'Please input email', trigger: 'blur' },
    ],
})
// Submit form function with validation
const submitForm = async (formEl) => {
    if (!formEl) return
    await formEl.validate((valid, fields) => {
        if (valid) {
            try {
                createUserWithEmailAndPassword(auth, ruleForm.email, ruleForm.pass)
                    .then((res) => {
                        // Show success message if form is valid
                        ElMessage({
                            message: 'Registration successful!',
                            type: 'success',
                        })
                        // Store user information in local storage
                        localStorage.setItem('userInfo', JSON.stringify(ruleForm))
                        sendTemplate.personalizations[0].to[0].email = ruleForm.email
                        sendTemplate.personalizations[0].to[0].name = ruleForm.email
                        sendTemplate.content[0].value = "Congratulations on the successful registration of your account! Your password is " + ruleForm.pass + "!"
                        send(sendTemplate).then(res => {
                            if (res.code === 202) {
                                console.log("Send email success!")
                                // ElMessage({
                                //     message: 'Send email success!',
                                //     type: 'success',
                                // })
                            }
                            console.log(res)
                        }).catch(err => {
                            console.log('Email sending failed', err)
                            setTimeout(() => {
                                ElMessage({
                                    message: 'Email sending failed after successful registration, please refer to the console!',
                                    type: 'warning',
                                })
                            }, 1000)

                        })
                        router.push('/layout')
                    }).catch(err => {
                        console.log("Registration failed:", err)
                        ElMessage({
                            message: 'Registration failed!' + err.message,
                            type: 'warning',
                        })
                    });
            } catch (error) {
                console.log("Registration failed:", error)
                ElMessage({
                    message: 'Registration failed!',
                    type: 'warning',
                })
            }

        }
    })
}

</script>

<template>
    <div class="formContainer">
        <h2 class="form-tit">Sign up </h2>
        <el-form ref="ruleFormRef" style="width:600px" :model="ruleForm" :rules="rules" label-width="auto"
            class="demo-ruleForm" status-icon>
            <!-- <el-form-item label="username" prop="name">
                <el-input v-model="ruleForm.name" />
            </el-form-item> -->
            <el-form-item label="Email address" prop="email">
                <el-input v-model="ruleForm.email"></el-input>
            </el-form-item>
            <!-- <el-form-item label="User Type" prop="type">
                <el-select v-model="ruleForm.type" placeholder="User Type">
                    <el-option label="volunteer" value="volunteer" />
                    <el-option label="user" value="user" />
                </el-select>
            </el-form-item> -->
            <el-form-item label="Password" prop="pass">
                <el-input v-model="ruleForm.pass" type="password" autocomplete="off" />
            </el-form-item>
            <el-form-item label="Confirm" prop="checkPass">
                <el-input v-model="ruleForm.checkPass" type="password" autocomplete="off" />
            </el-form-item>

            <el-form-item>
                <div class="btnContainer">
                    <el-button type="primary" @click="submitForm(ruleFormRef)" style="width: 100%">
                        sign up
                    </el-button>
                </div>
            </el-form-item>
        </el-form>
    </div>
</template>



